import "./App.css";
import ServiceList from "./components/ServiceList";
import AddService from "../src/components/AddService";
import { Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <nav>
        <Link to="/">Service List</Link>
        <Link to="/create">Create New</Link>
      </nav>

      <section></section>
    </div>
  );
}

export default App;
